import logo from "./logo.svg";
import "./App.css";

import Navbar from "./components/Navbar";
import HomePage from "./pages/HomePage";

function App() {
  return (
    <Router>
      <AuthProvider>
        <div className="App">
          <Navbar />
          <Routes>
            <Route path="/" element={<HomePage />} />
          </Routes>
          <HomePage />
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
